import '../css/detail.css';
import Header from '../components/Header';
import Footer from '../components/Footer';
import CartScreen from '../components/cart';

function Cart() {
    return (
      <>
      <Header />
      <div className="content">
        <div className="product">
          <CartScreen/>
        </div>
      </div>
      <Footer />
      </>
    )
  }
  
  export default Cart;
